import React from 'react';
import '../styles/Lists.scss'; 

function Lists() {
    return(
        <div className='marquee'>
            <p>Test1</p>
            <p>Test2</p>
            <p>Test3</p>
            <p>Test4</p>
            <p>Test5</p>
            <p>Test6</p>
            <p>Test7</p>
            <p>Test8</p> 
            <p>Test9</p>
            <p>Test10</p>                
        </div>
    );
}



export default Lists;
